import React from "react";
import ReactDOM from "react-dom";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src="./images/logo.svg" />
        <nav className="mainNav">
          <a href="">Home</a>
          <a href="">About Me</a>
          <a href="">My Work</a>
          <a href="">Contact Me</a>
        </nav>
        <div className='headerElements'>
          <div className='headerText headerItem'>
            <h1>Hi,</h1>
            <h1>I'm Matt.</h1>
            <h1>I build cool things.</h1>
          </div>
          <div className='headerImages headerItem'>
            <div className='headerImg'><img src='' />Test Image</div>
            <div className='headerImg'><img src='' />Test Image 2</div>
            <div className='headerImg'><img src='' />Test Image 3</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
